                    Отыщите в виртуальных чат комнатах остатки его записей, которые не успели разложиться от диджитации. Возможно, вам понадобятся специальные очки.
                </div>
                <Form submit={this.submitHandler.bind(this)}/>
            </div>
        )
    }
}

